import React from 'react';
import { Container,Grid, Grid2, Card, CardContent, Typography, CardMedia, Box } from '@mui/material';

const items = [
  { name: 'Tin', quantity: 25548 },
  { name: 'Env', quantity: 25548 },
  { name: 'Tin', quantity: 25548 },
  { name: 'Env', quantity: 25548 },
  { name: 'Tin', quantity: 25548 },
  { name: 'Tin', quantity: 25548 },
];

const ItemTypes = () => {
  return (
    <Container maxWidth="xlg" sx={{ padding: '30px' }}>
      <Typography variant="heading" gutterBottom sx={{bgcolor: 'primary.main', paddingY: '10px', textAlign: 'left'}}>
        Aging Packing Materials Stock Management System
      </Typography>
      <Typography variant="h5" gutterBottom>
        Item Type
      </Typography>
      <Grid container spacing={6} sx={{paddingX: '20px'}}>
        {items.map((item, index) => (
          <Grid item xs={6} sm={4} md={3} key={index}>
            <Card sx={{ textAlign: 'center', '&:hover': { boxShadow: 6 } }}>
              <CardMedia
                component="img"
                height="140"
                image="https://via.placeholder.com/150"
                alt={`${item.name} image`}
              />
              <CardContent>
                <Typography variant="h6">{item.name}</Typography>
                <Typography variant="body2" color="textSecondary">
                  Qty - {item.quantity}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default ItemTypes;
